INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130011, 3001100, 2.1, -416.5, 2, "2030/01/01 14:59:59", "ヤマト", 1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 3001, 0.0, "2024/10/31 12:00:00", 100);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130011, 3001101, 5.68, -416.5, 2, "2030/01/01 14:59:59", "ヤマト", 4, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 3001, 0.0, "2024/10/31 12:00:00", 101);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130011, 3001102, 0.0, -416.5, 1, "2030/01/01 14:59:59", "ヤマト", 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 3001, 0.0, "2024/10/31 12:00:00", 102);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002100, 0.0, -416.5, 1, "2030/01/01 14:59:59", "フブキ", 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 3002, 0.0, "2024/10/31 12:00:00", 100);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002101, 0.0, -416.5, 1, "2030/01/01 14:59:59", "フブキ", 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 3002, 0.0, "2024/10/31 12:00:00", 101);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002102, 8.53, -416.5, 2, "2030/01/01 14:59:59", "フブキ", 5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 3002, 0.0, "2024/10/31 12:00:00", 102);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002103, 5.67, -416.5, 1, "2030/01/01 14:59:59", "フブキ", 7, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 3002, 0.0, "2024/10/31 12:00:00", 103);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002104, 0.0, -416.5, 1, "2030/01/01 14:59:59", "フブキ", 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 3002, 0.0, "2024/10/31 12:00:00", 104);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002300, 0.0, -416.5, 3, "2030/01/01 14:59:59", "フブキ", 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3004, 0.0, "2024/10/31 12:00:00", 300);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3002400, 0.0, -416.5, 7, "2030/01/01 14:59:59", "フブキ", 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 3005, 0.0, "2024/10/31 12:00:00", 301);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3003200, 4.4, -416.5, 1, "2030/01/01 14:59:59", "フブキ", 2, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 3003, 0.0, "2024/10/31 12:00:00", 200);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3003201, 0.0, -416.5, 7, "2030/01/01 14:59:59", "フブキ", 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 3003, 0.0, "2024/10/31 12:00:00", 201);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (130211, 3003202, 5.6, -416.5, 2, "2030/01/01 14:59:59", "フブキ", 1, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 3003, 0.0, "2024/10/31 12:00:00", 202);
